import Tab from 'react-bootstrap/Tab';
import Tabs from 'react-bootstrap/Tabs';
import Cards from '../Card/Cards';

function ItemsTab(props) {
  return (
    <Tabs style={{marginLeft: '5%', marginRight:'5%'}}
      variant='pills'
      defaultActiveKey="1"
      id="justify-tab-example"
      className="mb-3"
      justify={true}
    >
      
      <Tab eventKey="1" title="Pizza's">
        <Cards menu={props.menu} />
      </Tab>
      <Tab eventKey="2" title="Chinese">
        <Cards menu={props.menu} />
      </Tab>
      <Tab eventKey="3" title="south">
        <Cards menu={props.menu} />
      </Tab>
      <Tab eventKey="4" title="Northern Tadka">
        <Cards menu={props.menu} />
      </Tab>
    </Tabs>
  );
}

export default ItemsTab;
